import React from 'react';

const CollectionPreview = ({ title, items }) => {
	const fourItems = items.slice(0, 4);
	return (
		<div>
			<h1>{title}</h1>
			<div>
				{items.map(item => (
					<div key={item.id}>{item.name}</div>
				))}
			</div>
		</div>
	);
};

export default CollectionPreview;
